import React, { Component } from "react";

class When extends Component {
	render() {
		return (
			<>
				<div id="when" className="section-content section-dark">
					<div className="row">
						<div className="col">
							<h2>When</h2>
							<p>
								Monday
								<br />
								28 November 2022
							</p>
						</div>
						<div className="col">222</div>
					</div>
				</div>
			</>
		);
	}
}

export default When;
